import React from 'react'
import Templete from '../Templetes/Templete.jsx'

const Sobre = () => {

    return (

        <Templete>
            <h3>Sobre o Projeto</h3>
            <p>Exposição e conhecimento de habilidades / Skills requeridas de muitos Professores que migraram do Ensino Presencial para o Ensino On-line – tanto em Redes Públicas como em Redes privadas. Os vários desafios de interagir  com  as ferramentas de Tecnologia e ainda ser um processo humanizado. Onde as mesmas foram intensificadas em espaços Educacionais que já possuíam o Ensino Híbrido.  Perceber as barreiras e resistências por parte de profissionais sob o aspecto de adquirir ou até mesmo fortalecer essas ferramentas no Ensino On-line.</p>
        </Templete>
    )
}

export default Sobre
